import { useState, useEffect } from "react";
import { Nav, Navbar, Button } from "react-bootstrap";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import "./App.css";

const App = () => {
  const [placeholder, setPlaceholder] = useState("Hi");

  useEffect(() => {
    fetch("/hello")
      .then((res) => res.json())
      .then((data) => {
        console.log("data", data);
        setPlaceholder(data);
        // setPlaceholder(data.result);
      });
  }, []);

  return (
    <div className="main">
      <div>
        <Navbar className="colorNav">
          {/* <Nav activeKey="/home"> */}
          <Navbar.Link href="/home" onSelect={() => alert(`selected home`)}>
            Home
          </Navbar.Link>
          <Navbar.Link
            href="/about-us"
            onSelect={() => alert(`selected about-us`)}
          >
            About Us
          </Navbar.Link>
          <Navbar.Link href="/vision" onSelect={() => alert(`selected vision`)}>
            Our Vision
          </Navbar.Link>
          <Navbar.Link href="/login" onSelect={() => alert(`selected login`)}>
            Login
          </Navbar.Link>
          {/* </Nav> */}
        </Navbar>
      </div>
      <div>
        <h3 className="content">
          Find new and
          <br />
          meaningful
          <br />
          connections
          <br />
          easily
        </h3>
        <p className="content-paragraph">
          Create new friendships and meet
          <br />
          new people around you based on
          <br />
          your mutual interests and hobbies
        </p>
        <Button href="#" variant="primary">
          Flask says: {placeholder}
        </Button>
        {/* <p className="i-want-button">Flask says {placeholder}</p> */}
      </div>
    </div>
  );
};

export default App;
